    const [AthletesInfo, setAthletesInfo] = useState<AthletesInfo[]>([]);

    return (
        <div>
            <form>
                <input type="text" name="athleteName" placeholder="Your Name" />
                <input type="date" name="bod" placeholder="Birthday" />
                <input type="text" name="phone" placeholder="Phone Number" />
                <input type="password" name="password" placeholder="password" />
                <input type="texxt" name="atheleteAddr" placeholder="addr" />
                <input type="text" name="hkid" placeholder="HKID first 4 digit" />
            </form>
        </div>
    )
}

export default AthletesInfoForm;
